import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import Profile from './components/ProfileComponent';

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  <Profile />,
  document.getElementById('root')
);
